i-font-family:Calibri;\r\n--></tbody></table>', '<!--[if gte mso 9]><xml>\r\n <o:OfficeDocumentSettings>\r\n  <o:TargetScreenSize>800x600</o:TargetScreenSize>\r\n </o:OfficeDocumentSettings>\r\n</xml><![endif]-->\r\n\r\n<p class=\"MsoListParagraph\" style=\"margin-top:0in;margin-right:0in;\r\nmargin-bottom:7.25pt;margin-left:35.45pt;mso-add-space:auto;text-align:left;\r\ntext-indent:-21.25pt;mso-list:l3 level1 lfo1\" align=\"left\"><span style=\"font-size:14.0pt;mso-bidi-font-size:12.0pt;line-height:102%;font-family:\r\n\" areal\",\"serif\";mso-fareast-font-family:areal;mso-bidi-font-family:areal\"=\"\"><span style=\"mso-list:Ignore\">31.<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\"></span></span></span><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:12.0pt;line-height:\r\n102%;font-family:\" areal\",\"serif\"\"=\"\">Sertifikasi kompetensi kerja </span></b><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:12.0pt;\r\nline-height:102%;font-family:\" areal\",\"serif\";mso-ansi-language:in\"=\"\" lang=\"IN\">:</span></b><span style=\"font-size:12.0pt;line-height:102%;font-family:\" areal\",\"serif\"\"=\"\"></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:7.25pt;\r\nmargin-left:35.45pt;text-align:justify\"><span style=\"font-size:12.0pt;\r\nfont-family:\" areal\",\"serif\"\"=\"\">Proses pemberian sertifikat kompetensi yang\r\ndilakukan secara sistematis dan obyektif melalui uji kompetensi yang mengacu\r\nkepada standar kompetensi kerja nasional Indonesia, standar internasional\r\ndan/atau standar khusus. </span></p>\r\n\r\n<p class=\"MsoListParagraph\" style=\"margin-top:0in;margin-right:0in;margin-bottom:\r\n7.25pt;margin-left:35.45pt;mso-add-space:auto;text-indent:-21.25pt;mso-list:\r\nl2 level2 lfo2\"><span style=\"font-size:14.0pt;mso-bidi-font-size:\r\n12.0pt;line-height:102%;font-family:\" areal\",\"serif\";mso-fareast-font-family:=\"\" areal;mso-bidi-font-family:areal\"=\"\"><span style=\"mso-list:Ignore\">32<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\"> <b>Sta</b></span></span></span><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:12.0pt;line-height:\r\n102%;font-family:\" areal\",\"serif\"\"=\"\">ndar Kompetensi Kerja Nasional Indonesia </span></b><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:12.0pt;\r\nline-height:102%;font-family:\" areal\",\"serif\";mso-ansi-language:in\"=\"\" lang=\"IN\">:</span></b><span style=\"font-size:12.0pt;line-height:102%;font-family:\" areal\",\"serif\"\"=\"\"></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:13.55pt;\r\nmargin-left:35.45pt;text-align:justify;text-indent:.55pt\"><span style=\"font-size:12.0pt;font-family:\" areal\",\"serif\"\"=\"\">Rumusan kemampuan kerja\r\nyang mencakup aspek pengetahuan, keterampilan dan/atau keahlian serta sikap\r\nkerja yang relevan dengan pelaksanaan tugas dan syarat jabatan yang ditetapkan\r\nsesuai dengan ketentuan peraturan perundang-undangan yang berlaku. </span></p>\r\n\r\n<p class=\"MsoListParagraph\" style=\"margin-top:0in;margin-right:0in;margin-bottom:\r\n7.25pt;margin-left:35.45pt;mso-add-space:auto;text-indent:-21.25pt;mso-list:\r\nl2 level2 lfo2\"><span style=\"font-size:14.0pt;mso-bidi-font-size:\r\n12.0pt;line-height:102%;font-family:\" areal\",\"serif\";mso-fareast-font-family:=\"\" areal;mso-bidi-font-family:areal\"=\"\"><span style=\"mso-list:Ignore\">3.3<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\">&nbsp; </span></span></span><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:12.0pt;line-height:\r\n102%;font-family:\" areal\",\"serif\"\"=\"\">Standar kompetensi kerja internasional </span></b><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:12.0pt;\r\nline-height:102%;font-family:\" areal\",\"serif\";mso-ansi-language:in\"=\"\" lang=\"IN\">:</span></b><span style=\"font-size:12.0pt;line-height:102%;font-family:\" areal\",\"serif\"\"=\"\"></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:13.7pt;\r\nmargin-left:35.45pt;text-align:justify;text-indent:.55pt\"><span style=\"font-size:12.0pt;font-family:\" areal\",\"serif\"\"=\"\">Standar kompetensi kerja\r\nyang dikembangkan dan ditetapkan oleh suatu organisasi multinasional dan\r\ndigunakan secara internasional<span style=\"mso-spacerun:yes\">&nbsp; </span></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:7.25pt;\r\nmargin-left:35.45pt;text-align:justify;text-indent:-21.25pt;line-height:102%;\r\nmso-list:l2 level2 lfo2\"><span style=\"font-size:14.0pt;\r\nmso-bidi-font-size:12.0pt;line-height:102%;font-family:\" areal\",\"serif\";=\"\" mso-fareast-font-family:areal;mso-bidi-font-family:areal\"=\"\"><span style=\"mso-list:Ignore\">3.4<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\">&nbsp; </span></span></span><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:12.0pt;line-height:\r\n102%;font-family:\" areal\",\"serif\"\"=\"\">Standar kompetensi kerja khusus </span></b><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:12.0pt;\r\nline-height:102%;font-family:\" areal\",\"serif\";mso-ansi-language:in\"=\"\" lang=\"IN\">:</span></b><span style=\"font-size:12.0pt;line-height:102%;font-family:\" areal\",\"serif\"\"=\"\"></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:13.7pt;\r\nmargin-left:35.45pt;text-align:justify;text-indent:.55pt\"><span style=\"font-size:12.0pt;font-family:\" areal\",\"serif\"\"=\"\">Standar kompetensi kerja\r\nyang dikembangkan dan digunakan oleh organisasi untuk memenuhi tujuan\r\norganisasinya sendiri dan/atau untuk memenuhi kebutuhan organisasi lain yang\r\nmemiliki ikatan kerja sama dengan organisasi <a name=\"_GoBack\"></a>yang\r\nbersangkutan atau organisasi lain yang memerlukan<span style=\"mso-spacerun:yes\">&nbsp; </span></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:7.25pt;\r\nmargin-left:35.45pt;text-align:justify;text-indent:-21.25pt;line-height:102%;\r\nmso-list:l2 level2 lfo2\"><span style=\"font-size:14.0pt;\r\nmso-bidi-font-size:12.0pt;line-height:102%;font-family:\" areal\",\"serif\";=\"\" mso-fareast-font-family:areal;mso-bidi-font-family:areal\"=\"\"><span style=\"mso-list:Ignore\">3.5<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\">&nbsp; </span></span></span><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:12.0pt;line-height:\r\n102%;font-family:\" areal\",\"serif\"\"=\"\">Profesi </span></b><b style=\"mso-bidi-font-weight:\r\nnormal\"><span style=\"font-size:12.0pt;line-height:102%;font-family:\r\n\" areal\",\"serif\";mso-ansi-language:in\"=\"\" lang=\"IN\">:</span></b><span style=\"font-size:12.0pt;\r\nline-height:102%;font-family:\" areal\",\"serif\"\"=\"\"></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:13.35pt;\r\nmargin-left:35.45pt;text-align:justify;text-indent:.55pt\"><span style=\"font-size:12.0pt;font-family:\" areal\",\"serif\"\"=\"\">Bidang pekerjaan yang\r\nmemiliki kompetensi tertentu yang diakui oleh masyarakat </span><span style=\"font-size:12.0pt;font-family:\" areal\",\"serif\";mso-ansi-language:in\"=\"\" lang=\"IN\"></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:13.35pt\"><span style=\"font-size:12.0pt;font-family:\" areal\",\"serif\";mso-ansi-language:in\"=\"\" lang=\"IN\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:7.25pt;\r\nmargin-left:14.75pt;line-height:102%\"><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:12.0pt;line-height:102%;font-family:\" areal\",\"serif\";=\"\" mso-ansi-language:in\"=\"\" lang=\"IN\">3.6 </span></b><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:12.0pt;line-height:102%;font-family:\" areal\",\"serif\"\"=\"\">Proses\r\nsertifikasi </span></b><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:12.0pt;line-height:102%;font-family:\" areal\",\"serif\";=\"\" mso-ansi-language:in\"=\"\" lang=\"IN\">:</span></b><span style=\"font-size:12.0pt;\r\nline-height:102%;font-family:\" areal\",\"serif\";mso-ansi-language:in\"=\"\" lang=\"IN\"></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:11.65pt;\r\nmargin-left:35.45pt;text-align:justify;text-indent:.55pt;line-height:102%\"><span style=\"font-size:12.0pt;line-height:102%;font-family:\" areal\",\"serif\"\"=\"\">Kegiatan\r\nlembaga sertifikasi profesi dalam menentukan bahwa seseorang memenuhi\r\npersyaratan sertifikasi, yang mencakup pendaftaran, penilaian, keputusan sertifikasi,\r\npemeliharaan sertifikasi, sertifikasi ulang, dan penggunaan sertifikat maupun\r\nlogo atau penanda (<i style=\"mso-bidi-font-style:normal\">mark</i>).<span style=\"mso-spacerun:yes\">&nbsp; </span></span><span style=\"font-size:12.0pt;\r\nline-height:102%;font-family:\" areal\",\"serif\";mso-ansi-language:in\"=\"\" lang=\"IN\"></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:7.25pt;\r\nmargin-left:46.4pt;text-align:justify;text-indent:-32.2pt;line-height:102%;\r\nmso-list:l0 level2 lfo3\"><b style=\"mso-bidi-font-weight:\r\nnormal\"><span style=\"font-size:12.0pt;line-height:102%;font-family:\" areal\",\"serif\";=\"\" mso-fareast-font-family:areal;mso-bidi-font-family:areal\"=\"\"><span style=\"mso-list:Ignore\">3.7<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\"> Skem</span></span></span></b><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:12.0pt;line-height:102%;font-family:\" areal\",\"serif\"\"=\"\">a\r\nsertifikasi </span></b><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:12.0pt;line-height:102%;font-family:\" areal\",\"serif\";=\"\" mso-ansi-language:in\"=\"\" lang=\"IN\">:</span></b><span style=\"font-size:12.0pt;line-height:\r\n102%;font-family:\" areal\",\"serif\"\"=\"\"></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:11.65pt;\r\nmargin-left:35.45pt;text-align:justify;text-indent:.55pt\"><span style=\"font-size:12.0pt;font-family:\" areal\",\"serif\"\"=\"\">Paket kompetensi dan\r\npersyaratan spesifik<span style=\"mso-spacerun:yes\">&nbsp; </span>yang berkaitan\r\ndengan kategori jabatan atau keterampilan tertentu dari seseorang. </span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:4.2pt;\r\nmargin-left:35.45pt;text-align:justify;text-indent:-21.25pt;line-height:102%;\r\nmso-list:l0 level2 lfo3\"><b style=\"mso-bidi-font-weight:\r\nnormal\"><span style=\"font-size:12.0pt;line-height:102%;font-family:\" areal\",\"serif\";=\"\" mso-fareast-font-family:areal;mso-bidi-font-family:areal\"=\"\"><span style=\"mso-list:Ignore\">3.8<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\">&nbsp; </span></span></span></b><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:12.0pt;line-height:102%;font-family:\" areal\",\"serif\"\"=\"\">Persyaratan\r\nSertifikasi </span></b><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:12.0pt;line-height:102%;font-family:\" areal\",\"serif\";=\"\" mso-ansi-language:in\"=\"\" lang=\"IN\">:</span></b><span style=\"font-size:12.0pt;line-height:\r\n102%;font-family:\" areal\",\"serif\"\"=\"\"></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:15.9pt;\r\nmargin-left:35.45pt;text-align:justify;text-indent:.55pt\"><span style=\"font-size:12.0pt;font-family:\" areal\",\"serif\"\"=\"\">Kumpulan<span style=\"mso-spacerun:yes\">&nbsp; </span>persyaratan yang ditentukan, termasuk\r\npersyaratan skema sertifikasi yang harus dipenuhi dalam menetapkan atau\r\nmemelihara sertifikasi.<span style=\"mso-spacerun:yes\">&nbsp; </span></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:7.25pt;\r\nmargin-left:35.45pt;text-align:justify;text-indent:-21.25pt;line-height:102%;\r\nmso-list:l0 level2 lfo3\"><b style=\"mso-bidi-font-weight:\r\nnormal\"><span style=\"font-size:12.0pt;line-height:102%;font-family:\" areal\",\"serif\";=\"\" mso-fareast-font-family:areal;mso-bidi-font-family:areal\"=\"\"><span style=\"mso-list:Ignore\">3.9<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\">&nbsp;&nbsp;&nbsp;\r\n</span></span></span></b><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:12.0pt;line-height:102%;font-family:\" areal\",\"serif\"\"=\"\">Pemilik\r\nskema</span></b><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:12.0pt;line-height:102%;font-family:\" areal\",\"serif\";=\"\" mso-ansi-language:in\"=\"\" lang=\"IN\"> :</span></b><span style=\"font-size:12.0pt;line-height:\r\n102%;font-family:\" areal\",\"serif\"\"=\"\"></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:13.35pt;\r\nmargin-left:35.45pt;text-align:justify;text-indent:.55pt\"><span style=\"font-size:12.0pt;font-family:\" areal\",\"serif\"\"=\"\">Organisasi yang\r\nbertanggung jawab dalam pengembangan dan pemeliharaan skema sertifikasi <span style=\"mso-spacerun:yes\">&nbsp;</span></span><span style=\"font-size:12.0pt;\r\nfont-family:\" areal\",\"serif\";mso-ansi-language:in\"=\"\" lang=\"IN\"></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:7.25pt;\r\nmargin-left:35.45pt;text-align:justify;text-indent:-21.25pt;line-height:102%;\r\nmso-list:l0 level2 lfo3;tab-stops:35.45pt\"><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:12.0pt;line-height:\r\n102%;font-family:\" areal\",\"serif\";mso-fareast-font-family:areal;mso-bidi-font-family:=\"\" areal\"=\"\"><span style=\"mso-list:Ignore\">3.10</span></span></b><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:12.0pt;line-height:\r\n102%;font-family:\" areal\",\"serif\"\"=\"\">Sertifikat </span></b><b style=\"mso-bidi-font-weight:\r\nnormal\"><span style=\"font-size:12.0pt;line-height:102%;font-family:\r\n\" areal\",\"serif\";mso-ansi-language:in\"=\"\" lang=\"IN\">:</span></b><span style=\"font-size:12.0pt;\r\nline-height:102%;font-family:\" areal\",\"serif\"\"=\"\"></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:10.0pt;\r\nmargin-left:35.45pt;text-align:justify;text-indent:.55pt\"><span style=\"font-size:12.0pt;font-family:\" areal\",\"serif\"\"=\"\">Dokumen yang diterbitkan\r\noleh lembaga sertifikasi profesi, yang menunjukkan bahwa orang yang tercantum\r\nnamanya telah memenuhi persyaratan sertifikasi</span><span style=\"font-size:12.0pt;font-family:\" areal\",\"serif\";mso-ansi-language:in\"=\"\" lang=\"IN\">.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:14.15pt;margin-right:0in;margin-bottom:\r\n7.25pt;margin-left:35.45pt;text-align:justify;text-indent:-28.35pt;line-height:\r\n102%;mso-list:l0 level2 lfo3\"><b style=\"mso-bidi-font-weight:\r\nnormal\"><span style=\"font-size:12.0pt;line-height:102%;font-family:\" areal\",\"serif\";=\"\" mso-fareast-font-family:areal;mso-bidi-font-family:areal\"=\"\"><span style=\"mso-list:Ignore\">3.11<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span></b><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:12.0pt;line-height:102%;font-family:\" areal\",\"serif\"\"=\"\">Kompetensi\r\n</span></b><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:12.0pt;line-height:102%;font-family:\" areal\",\"serif\";=\"\" mso-ansi-language:in\"=\"\" lang=\"IN\">:</span></b><span style=\"font-size:12.0pt;line-height:\r\n102%;font-family:\" areal\",\"serif\"\"=\"\"></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:13.35pt;\r\nmargin-left:35.45pt;text-align:justify;text-indent:.55pt\"><span style=\"font-size:12.0pt;font-family:\" areal\",\"serif\"\"=\"\">Kemampuan kerja setiap\r\nindividu yang mencakup aspek pengetahuan, keterampilan, dan sikap kerja yang\r\nsesuai dengan standar yang ditetapkan. </span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:7.25pt;\r\nmargin-left:35.45pt;text-align:justify;text-indent:-28.35pt;line-height:102%;\r\nmso-list:l0 level2 lfo3\"><b style=\"mso-bidi-font-weight:\r\nnormal\"><span style=\"font-size:12.0pt;line-height:102%;font-family:\" areal\",\"serif\";=\"\" mso-fareast-font-family:areal;mso-bidi-font-family:areal\"=\"\"><span style=\"mso-list:Ignore\">3.12<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\"> </span></span></span></b><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:12.0pt;line-height:102%;font-family:\" areal\",\"serif\"\"=\"\">Kualifikasi\r\n</span></b><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:12.0pt;line-height:102%;font-family:\" areal\",\"serif\";=\"\" mso-ansi-language:in\"=\"\" lang=\"IN\">:</span></b><span style=\"font-size:12.0pt;line-height:\r\n102%;font-family:\" areal\",\"serif\"\"=\"\"></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:13.35pt;\r\nmargin-left:35.45pt;text-align:justify;text-indent:.55pt\"><span style=\"font-size:12.0pt;font-family:\" areal\",\"serif\"\"=\"\">Penguasaan capaian\r\npembelajaran yang menyatakan kedudukannya dalam Kerangka Kualifikasi Nasional\r\nIndonesia (KKNI) </span></p><b style=\"mso-bidi-font-weight:\r\nnormal\"><span style=\"font-size:12.0pt;line-height:102%;font-family:\" areal\",\"serif\";=\"\" mso-fareast-font-family:areal;mso-bidi-font-family:areal\"=\"\"><span style=\"mso-list:Ignore\">3.13<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\">&nbsp;&nbsp; </span></span></span></b><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:12.0pt;line-height:102%;font-family:\" areal\",\"serif\"\"=\"\">Kerangka\r\nKualifikasi Nasional Indonesia </span></b><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:12.0pt;line-height:102%;font-family:\" areal\",\"serif\";=\"\" mso-ansi-language:in\"=\"\" lang=\"IN\">:</span></b><span style=\"font-size:12.0pt;line-height:\r\n102%;font-family:\" areal\",\"serif\"\"=\"\"></span>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:11.25pt;\r\nmargin-left:35.45pt;text-align:justify;text-indent:.55pt\"><span style=\"font-size:12.0pt;font-family:\" areal\",\"serif\"\"=\"\">Kerangka penjenjangan\r\nkualifikasi kompetensi yang dapat menyandingkan, menyetarakan, dan\r\nmengintegrasikan antara bidang pendidikan dan bidang pelatihan kerja serta\r\npengalaman kerja dalam rangka pemberian pengakuan kompetensi kerja sesuai\r\ndengan struktur pekerjaan di berbagai sektor. </span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:13.4pt;\r\nmargin-left:35.45pt;text-align:justify;text-indent:.55pt\"><span style=\"font-size:12.0pt;font-family:\" areal\",\"serif\"\"=\"\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:11.65pt;\r\nmargin-left:35.45pt;text-align:justify;text-indent:.55pt;line-height:102%;\r\nmso-list:l0 level2 lfo3\"><b style=\"mso-bidi-font-weight:\r\nnormal\"><span style=\"font-size:12.0pt;line-height:102%;font-family:\" areal\",\"serif\";=\"\" mso-fareast-font-family:areal;mso-bidi-font-family:areal\"=\"\"><span style=\"mso-list:Ignore\">3.14<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span></b><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:12.0pt;line-height:102%;font-family:\" areal\",\"serif\"\"=\"\">Asesmen </span></b><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:12.0pt;\r\nline-height:102%;font-family:\" areal\",\"serif\";mso-ansi-language:in\"=\"\" lang=\"IN\">:</span></b><span style=\"font-size:12.0pt;line-height:102%;font-family:\" areal\",\"serif\"\"=\"\"></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:13.55pt;\r\nmargin-left:35.45pt;text-align:justify;text-indent:.55pt\"><span style=\"font-size:12.0pt;font-family:\" areal\",\"serif\"\"=\"\">Proses penilaian kepada\r\nseseorang terhadap pemenuhan persyaratan yang ditetapkan dalam skema\r\nsertifikasi</span><span style=\"font-size:12.0pt;font-family:\" areal\",\"serif\";=\"\" mso-ansi-language:in\"=\"\" lang=\"IN\">.</span><span style=\"font-size:12.0pt;font-family:\" areal\",\"serif\"\"=\"\">\r\n</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:7.25pt;\r\nmargin-left:35.45pt;text-align:justify;text-indent:.55pt;line-height:102%;\r\nmso-list:l0 level2 lfo3\"><b style=\"mso-bidi-font-weight:\r\nnormal\"><span style=\"font-size:12.0pt;line-height:102%;font-family:\" areal\",\"serif\";=\"\" mso-fareast-font-family:areal;mso-bidi-font-family:areal\"=\"\"><span style=\"mso-list:Ignore\">3.15<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span></b><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:12.0pt;line-height:102%;font-family:\" areal\",\"serif\"\"=\"\">Uji\r\nkompetensi<span style=\"mso-spacerun:yes\">&nbsp; </span></span></b><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:12.0pt;\r\nline-height:102%;font-family:\" areal\",\"serif\";mso-ansi-language:in\"=\"\" lang=\"IN\">:</span></b><span style=\"font-size:12.0pt;line-height:102%;font-family:\" areal\",\"serif\"\"=\"\"></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:13.7pt;\r\nmargin-left:35.45pt;text-align:justify;text-indent:.55pt\"><span style=\"font-size:12.0pt;font-family:\" areal\",\"serif\"\"=\"\">Tatacara yang merupakan\r\nbagian dari asesmen untuk mengukur kompetensi peserta sertifikasi menggunakan\r\nsatu atau beberapa cara seperti tertulis, lisan, praktek, dan pengamatan,\r\nsebagaimana ditetapkan dalam skema sertifikasi</span><span style=\"font-size:12.0pt;font-family:\" areal\",\"serif\";mso-ansi-language:in\"=\"\" lang=\"IN\">.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:13.7pt;\r\nmargin-left:35.45pt;text-align:justify;text-indent:.55pt\"><b style=\"mso-bidi-font-weight:\r\nnormal\"><span style=\"font-size:12.0pt;font-family:\" areal\",\"serif\";=\"\" mso-ansi-language:in\"=\"\" lang=\"IN\">3.16 <span style=\"mso-spacerun:yes\">&nbsp;&nbsp;&nbsp;&nbsp;</span></span></b><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:12.0pt;font-family:\r\n\" areal\",\"serif\"\"=\"\">Penguji kompetensi atau asesor kompetensi </span></b><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:12.0pt;\r\nfont-family:\" areal\",\"serif\";mso-ansi-language:in\"=\"\" lang=\"IN\">:</span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:13.55pt;\r\nmargin-left:35.45pt;text-align:justify;text-indent:.55pt\"><span style=\"font-size:12.0pt;font-family:\" areal\",\"serif\"\"=\"\">Orang yang mempunyai\r\nkompetensi dan mendapatkan penugasan resmi untuk melakukan dan memberikan\r\npenilaian dalam uji kompetensi yang memerlukan pertimbangan atau pembenaran\r\nsecara profesional. </span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:7.25pt;\r\nmargin-left:49.4pt;text-align:justify;text-indent:-21.0pt;line-height:102%;\r\nmso-list:l1 level2 lfo4\"><b style=\"mso-bidi-font-weight:\r\nnormal\"><span style=\"font-size:12.0pt;line-height:102%;font-family:\" areal\",\"serif\";=\"\" mso-fareast-font-family:areal;mso-bidi-font-family:areal\"=\"\"><span style=\"mso-list:Ignore\">3.17</span></span></b><b style=\"mso-bidi-font-weight:\r\nnormal\"><span