INSERT INTO `lsp` VALUES ('lsp135_', 'PUBLIC RELATIONS INDONESIA(PRI)', null, 'Jl. Daud 33, Kebayoran Lama, Jakarta Selatan', '', '021-729-4931', '021-4587989', 'm.basya@soel.co.id,  sekretariat@lsppri.or.id', 'lsppri@bnsp.go.id', 'www.lsppri.or.id', 'BNSP-LSP-135-ID', '2014-11-12', '0000-00-00', 'Y', '1225', 'PERHUMAS dan BAKOHUMAS', 'Kementrian Komunikasi dan Informatika', 'Kep.621/BNSP/XI/2014', '', '2014-11-12', '', 'Muslim Basya, BBA, MBA', '', '0', '0', '1453249137sppri.jpg', '2017-11-12', '', '<p class=\"MsoNormal\" align=\"left\"><span style=\"mso-bidi-font-family:\r\nCalibri;mso-bidi-theme-font:minor-latin;color:#333333;background:white\">Lembaga\r\nSertifikasi Profesi disingkat LSP, adalah Lembaga pelaksana kegiatan\r\nsertifikasi Profesi yang mendapat Lisensi dari BNSP (Badan Nasional Sertifikasi\r\nProfesi) setelah memenuhi persyaratan yang ditetapkan untuk melaksanakan\r\nsertifikasi kompetensi kerja.</span><span style=\"mso-bidi-font-family:\r\nCalibri;mso-bidi-theme-font:minor-latin;color:#333333\"><br>\r\n<span style=\"background:white\">Lembaga Sertifikasi Profesi Public Relations Indonesia\r\ndisingkat LSP PRI adalah sebuah Badan Hukum yang didirikan berdasarkan Akte\r\nNotaris Netty Maria Machdar SH Akta Pendirian LSP PRI No. 18. LSP PRI ini\r\ndidirikan dan dibentuk oleh 2 (dua) organisasi profesi Humas/Public Relations\r\nIndonesia, yaitu Badan Koordinasi Humas Pemerintah (BAKOHUMAS) dan Perhimpunan\r\nHubungan Masyarakat Indonesia (PERHUMAS) dengan tujuan meningkatkan profesi\r\npraktisi Public Relations/Humas Indonesia. LSP PRI juga didirikan oleh Kementerian\r\nKomunikasi dan Informatika (Kemkominfo) yang diwakili secara ex officio oleh\r\nDirektur Jenderal Informasi dan Komunikasi Publik dan Kepala Pusat Pelatihan\r\ndan Pengembangan (Puslitbang). Mewakili industri, Asosiasi Perusahaan Public\r\nRelations Indonesia (APPRI) juga merupakan pendiri dari LSP PRI.</span></span><span lang=\"EN-US\" style=\"mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;\r\ncolor:#333333;background:white;mso-ansi-language:EN-US\"><o:p></o:p></span></p>', 'Y', 'Y', 'Y', 'Y', 'Y', 'N', '', '12', '24', 'P3', 'lsp', '1', '', null, '0811 166 1696', '0811 166 1696', 'Sektor Komunikasi dan Informatika, Bidang Humas/Public Relations', 'DKI Jakarta', null, null, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', null, null, null, null, null, null, null, null);
