INSERT INTO `lsp` VALUES ('lsp309_', 'SMK PGRI 1 NGAWI', null, 'Jl. Rajawali No. 32 NGAWI', null, '0351-746081', '', 'lspsmkpgri1ngawi@gmail.com', 'smkpgringawi@bnsp.go.id', 'www.lsp.smkpgri1ngawi.sch.id', 'BNSP-LSP-309-ID', '2015-12-16', null, 'Y', null, '', '', 'KEP.1044/BNSP/XII/2015', null, '2015-01-01', null, 'Drs. Hidayat Machruf, M.Pd', null, '0', '0', '1454656773MK_PGRI_1_NGAWI.jpg', '2018-12-16', '<img src=\"http://www.smkpgri1ngawi.sch.id/lsp2/wp-content/uploads/2015/10/Struktur-Oganisasi-LSP_OK.png\">', '<font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Lembaga Sertifikasi Profesi (LSP) SMK PGRI 1 NGAWI adalah lembaga pendukung BNSP yang bertanggung jawab melaksanakan sertifikasi kompetensi profesi, dalam melaksanakan tugas dan fungsi, LSP SMK PGRI 1 NGAWI mengacu kepada Pedoman yang dikeluarkan BNSP. Dalam pedoman tersebut ditetapkan persyaratan yang harus ditaati untuk menjamin agar lembaga sertifikasi menjalankan prosedur sertifikasi kepada pihak ketiga secara konsisten dan profesional, sehingga dapat diterima di tingkat nasional yang relevan</span></font>', 'Y', 'Y', 'N', 'N', 'N', 'Y', 'aktif', '16', '31', 'P1', 'lsp', '1', null, '1454675653.jpeg', null, null, null, null, null, null, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', null, null, null, null, null, null, null, null);
