line-height:150%;font-family:\"Arial\",\"sans-serif\";\r\nmso-fareast-font-family:Arial\"><span style=\"mso-list:Ignore\">1.<span style=\"font:7.0pt \"Times New Roman\"\">Â Â Â Â Â  </span></span></span><span style=\"font-size:11.0pt;line-height:150%;font-family:\"Arial\",\"sans-serif\";\r\ncolor:black;mso-themecolor:text1;border:none windowtext 1.0pt;mso-border-alt:\r\nnone windowtext 0cm;padding:0cm\">Menyelenggarakan dan menyediakan pelatihan penguji\r\n(asesor) kompetensi yang bekerja sama dengan Master Asesor BNSP secara Profesional.</span><span style=\"font-size:11.0pt;line-height:150%;font-family:\"Arial\",\"sans-serif\"\"></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-align:justify;text-indent:-21.8pt;\r\nline-height:150%;mso-list:l0 level1 lfo1;background:white;vertical-align:baseline\"><span style=\"font-size:11.0pt;line-height:150%;font-family:\"Arial\",\"sans-serif\";\r\nmso-fareast-font-family:Arial;color:black;mso-themecolor:text1\"><span style=\"mso-list:Ignore\">2.<span style=\"font:7.0pt \"Times New Roman\"\">Â Â Â Â Â \r\n</span></span></span><span style=\"font-size:11.0pt;line-height:150%;\r\nfont-family:\"Arial\",\"sans-serif\"\">Memberikan pelayanan dan pengujian bagi peserta\r\n(asesi) <span style=\"color:black;mso-themecolor:text1;border:none windowtext 1.0pt;\r\nmso-border-alt:none windowtext 0cm;padding:0cm\">secara profesional</span> <span style=\"color:black;mso-themecolor:text1\"></span></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-align:justify;text-indent:-21.8pt;\r\nline-height:150%;mso-list:l0 level1 lfo1;background:white;vertical-align:baseline\"><span style=\"font-size:11.0pt;line-height:150%;font-family:\"Arial\",\"sans-serif\";\r\nmso-fareast-font-family:Arial;color:black;mso-themecolor:text1\"><span style=\"mso-list:Ignore\">3.<span style=\"font:7.0pt \"Times New Roman\"\">Â Â  </span></span></span><span style=\"font-size:11.0pt;line-height:150%;\r\nfont-family:\"Arial\",\"sans-serif\";color:black;mso-themecolor:text1;border:none windowtext 1.0pt;\r\nmso-border-alt:none windowtext 0cm;padding:0cm\">Meningkatkan kualitas, dan </span><span style=\"font-size:11.0pt;line-height:150%;font-family:\"Arial\",\"sans-serif\"\">persyaratan\r\nunit-unit kompetensi sesuai dengan peraturan perundang-undangan yang berlaku.<span style=\"color:black;mso-themecolor:text1\"></span></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-align:justify;text-indent:-21.8pt;\r\nline-height:150%;mso-list:l0 level1 lfo1;background:white;vertical-align:baseline\"><span style=\"font-size:11.0pt;line-height:150%;font-family:\"Arial\",\"sans-serif\";\r\nmso-fareast-font-family:Arial;color:black;mso-themecolor:text1\"><span style=\"mso-list:Ignore\">4.<span style=\"font:7.0pt \"Times New Roman\"\">Â Â  </span></span></span><span style=\"font-size:11.0pt;line-height:150%;\r\nfont-family:\"Arial\",\"sans-serif\";color:black;mso-themecolor:text1;border:none windowtext 1.0pt;\r\nmso-border-alt:none windowtext 0cm;padding:0cm\">Meningkatkan kualitas,\r\nkuantitas dan legalitas penguji (asesor) kompetensi yang lebih handal dan Kompeten</span><span style=\"font-size:11.0pt;line-height:150%;font-family:\"Arial\",\"sans-serif\";\r\ncolor:black;mso-themecolor:text1\"></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"text-align:justify;text-indent:-18.0pt;\r\nline-height:150%;mso-list:l0 level1 lfo1;background:white;vertical-align:baseline\"><span style=\"font-size:11.0pt;line-height:150%;font-family:\"Arial\",\"sans-serif\";\r\nmso-fareast-font-family:Arial;color:black;mso-themecolor:text1\"><span style=\"mso-list:Ignore\">5.<span style=\"font:7.0pt \"Times New Roman\"\">Â  </span></span></span><span style=\"font-size:11.0pt;line-height:150%;\r\nfont-family:\"Arial\",\"sans-serif\"\">Memelihara dan mengembangkan skema-skema\r\nsertifikasi bidang Teknik Kendaraan Ringan (TKR) yang sudah dilesensi oleh BNSP<span style=\"color:black;mso-themecolor:text1\"></span></span></p>\r\n\r\n<!--[if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves></w:TrackMoves>\r\n  <w:TrackFormatting></w:TrackFormatting>\r\n  <w:DoNotShowComments></w:DoNotShowComments>\r\n  <w:PunctuationKerning></w:PunctuationKerning>\r\n  <w:ValidateAgainstSchemas></w:ValidateAgainstSchemas>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF></w:DoNotPromoteQF>\r\n  <w:LidThemeOther>EN-US</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables></w:BreakWrappedTables>\r\n   <w:SnapToGridInCell></w:SnapToGridInCell>\r\n   <w:WrapTextWithPunct></w:WrapTextWithPunct>\r\n   <w:UseAsianBreakRules></w:UseAsianBreakRules>\r\n   <w:DontGrowAutofit></w:DontGrowAutofit>\r\n   <w:SplitPgBreakAndParaMark></w:SplitPgBreakAndParaMark>\r\n   <w:DontVertAlignCellWithSp></w:DontVertAlignCellWithSp>\r\n   <w:DontBreakConstrainedForcedTables></w:DontBreakConstrainedForcedTables>\r\n   <w:DontVertAlignInTxbx></w:DontVertAlignInTxbx>\r\n   <w:Word11KerningPairs></w:Word11KerningPairs>\r\n   <w:CachedColBalance></w:CachedColBalance>\r\n  </w:Compatibility>\r\n  <m:mathPr>\r\n   <m:mathFont m:val=\"Cambria Math\"></m:mathFont>\r\n   <m:brkBin m:val=\"before\"></m:brkBin>\r\n   <m:brkBinSub m:val=\"--\"></m:brkBinSub>\r\n   <m:smallFrac m:val=\"off\"></m:smallFrac>\r\n   <m:dispDef></m:dispDef>\r\n   <m:lMargin m:val=\"0\"></m:lMargin>\r\n   <m:rMargin m:val=\"0\"></m:rMargin>\r\n   <m:defJc m:val=\"centerGroup\"></m:defJc>\r\n   <m:wrapIndent m:val=\"1440\"></m:wrapIndent>\r\n   <m:intLim m:val=\"subSup\"></m:intLim>\r\n   <m:naryLim m:val=\"undOvr\"></m:naryLim>\r\n  </m:mathPr></w:WordDocument>\r\n</xml><![endif]--><!--[if gte mso 9]><xml>\r\n <w: