=\"font-weight: bold;\">Manajer Marketing</span><br><ol style=\"margin-left: 200px;\"><li>Toto Priyono, S.Pd.</li><li>Tutut Prasetiyanti, S.Pd.</li></ol><span style=\"font-weight: bold;\">Ketua TUK</span><br></div><ul style=\"margin-left: 120px;\"><li>T. Kendaraan Ringan<br></li></ul><div style=\"margin-left: 240px;\"><span>Aziz Budiraharjo, S.Pd<br><br></span></div><ul style=\"margin-left: 120px;\"><li><span style=\"color: rgb(255, 102, 102);\">T. Gambar Bangunan </span><span style=\"color: rgb(255, 102, 102);\"><span style=\"font-style: italic;\">(TUK dalam proses)</span></span></li></ul><div style=\"margin-left: 240px;\"><span style=\"color: rgb(255, 102, 102);\">Drs. Lilik Sukarli<br><br><span style=\"font-style: italic;\"></span></span></div><ul style=\"margin-left: 120px;\"><li><span style=\"color: rgb(255, 102, 102);\">T. Audio Video </span><span style=\"color: rgb(255, 102, 102);\"><span style=\"font-style: italic;\">(TUK dalam proses)</span></span></li></ul><div style=\"margin-left: 240px;\"><span style=\"color: rgb(255, 102, 102);\">Drs. Sarjana<br><br></span></div><ul style=\"margin-left: 120px;\"><li><span style=\"color: rgb(255, 102, 102);\">T. Otomasi Industri </span><span style=\"color: rgb(255, 102, 102);\"><span style=\"font-style: italic;\">(TUK dalam proses)</span></span></li></ul><div style=\"margin-left: 240px;\"><span style=\"color: rgb(255, 102, 102);\">Purboyono, S.Pd.T<br><br></span></div><ul style=\"margin-left: 120px;\"><li><span style=\"color: rgb(255, 102, 102);\">T. Permesinan </span><span style=\"color: rgb(255, 102, 102);\"><span style=\"font-style: italic;\">(TUK dalam proses)</span></span></li></ul><div style=\"margin-left: 240px;\"><span style=\"color: rgb(255, 102, 102);\">Sakri, S.Pd.,M.Si<br><br></span></div><ul style=\"margin-left: 120px;\"><li><span style=\"color: rgb(255, 102, 102);\">Multimedia </span><span style=\"color: rgb(255, 102, 102);\"><span style=\"font-style: italic;\">(TUK dalam proses)</span></span></li></ul><div style=\"margin-left: 240px;\"><span style=\"color: rgb(255, 102, 102);\">Ir. Nugroho Heru<br><br><br><br><br></span></div><div style=\"text-align: justify;\"><hr><img src=\"https://scontent-sin6-1.xx.fbcdn.net/v/t1.0-9/15078986_103864356766562_1763899390771546737_n.jpg?oh=eaa09bd78402ef7522baf837474cf154&amp;oe=58C18116\" style=\"width: 633px; height: 422px;\"><br><br></div><br>', '<font size=\"5\"><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size: 10pt; line-height: 150%; font-family: \"Arial Narrow\",\"sans-serif\";\" lang=\"IN\">LATAR BELAKANG PEMBENTUKAN LSP-P1 SMK N 2 PATI</span></b><b style=\"mso-bidi-font-weight:\r\nnormal\"><span style=\"font-size: 10pt; line-height: 150%; font-family: \"Arial Narrow\",\"sans-serif\";\" lang=\"SV\"></span></b></font><ul><li><span style=\"font-size:10.0pt;\r\nfont-family:\"Arial Narrow\",\"sans-serif\";mso-bidi-font-family:Arial;mso-ansi-language:\r\nSV\" lang=\"SV\">Memenuhi tuntutan dalam Undang-undang No. 20 Tahun 2003 pasal 61 bahwa\r\npeserta didik diberikan sertifikat berbentuk ijazah dan sertifikat kompetensi\r\nsebagai pengakuan atas jenjang pendidikan dan pengakuan kompetensi.</span></li><li><span style=\"font-size:10.0pt;\r\nfont-family:\"Arial Narrow\",\"sans-serif\";mso-bidi-font-family:Arial;mso-ansi-language:\r\nSV\" lang=\"SV\">LSP-P1 SMK NEGERI </span><span style=\"font-size:10.0pt;font-family:\r\n\"Arial Narrow\",\"sans-serif\";mso-bidi-font-family:Arial\" lang=\"IN\">2 PATI</span><span style=\"font-size:10.0pt;font-family:\"Arial Narrow\",\"sans-serif\";mso-bidi-font-family:\r\nArial;mso-ansi-language:SV\" lang=\"SV\">sebagai lembaga sertifikasi profesi ad hoc melaksanakan\r\nsertifikasi kompetensi lulsan SMK agar memenuhi tuntutan persyaratan kompetensi\r\ntenaga kerja menghadapi MEA dan persaingan global.</span></li><li><span style=\"font-size:10.0pt;font-family:\"Arial Narrow\",\"sans-serif\";mso-fareast-font-family:\r\n\"Arial Narrow\";mso-bidi-font-family:\"Arial Narrow\";mso-ansi-language:SV\" lang=\"SV\"><span style=\"mso-list:Ignore\">T</span></span><span style=\"font-size:10.0pt;\r\nfont-family:\"Arial Narrow\",\"sans-serif\";mso-bidi-font-family:Arial;color:black\" lang=\"IN\">untutan\r\npersyaratan kompetensi</span><span style=\"font-size:10.0pt;font-family:\"Arial Narrow\",\"sans-serif\";\r\nmso-bidi-font-family:Arial;color:black;mso-ansi-language:SV\" lang=\"SV\">setiap teknisi</span><span style=\"font-size:10.0pt;font-family:\"Arial Narrow\",\"sans-serif\";\r\nmso-bidi-font-family:Arial;color:black\" lang=\"IN\"> dalam </span><span style=\"font-size:10.0pt;font-family:\"Arial Narrow\",\"sans-serif\";mso-bidi-font-family:\r\nArial;color:black;mso-ansi-language:SV\" lang=\"SV\">melakukan perawatan dan perbaikan/servis\r\npada setiap bengkel kendaraan ringan.</span></li><li><span style=\"font-size:10.0pt;\r\nfont-family:\"Arial Narrow\",\"sans-serif\";mso-bidi-font-family:Arial;mso-ansi-language:\r\nSV\" lang=\"SV\">Sesuai regulasi akreditasi bengkel sebagaimana persyaratan Kemenperin,\r\nsetiap teknisi </span><span style=\"font-size:10.0pt;font-family:\"Arial Narrow\",\"sans-serif\";\r\nmso-ansi-language:SV;mso-bidi-font-weight:bold\" lang=\"SV\">kendaraan ringan harus mempunyai\r\nsertifikat<b><span style=\"color:#244061\"> </span></b></span><span style=\"font-size:10.0pt;font-family:\"Arial Narrow\",\"sans-serif\";mso-bidi-font-family:\r\nArial;mso-ansi-language:SV\" lang=\"SV\">kompetensi yang<span style=\"mso-spacerun:yes\">Â \r\n</span>dipersyaratkan.</span></li><li><span style=\"font-size:10.0pt;\r\nfont-family:\"Arial Narrow\",\"sans-serif\";mso-bidi-font-family:Arial;mso-ansi-language:\r\nSV\" lang=\"SV\">Pengakuan kompetensi lulusan SMK dengan kualifikasi II dapat ditempuh\r\ndengan cara akumulasi pencapaian kompetensi berdasarkan paket kompetensi\r\n(klaster) secara bertahap.</span>\r\n\r\n</li></ul>', 'Y', 'Y', 'Y', 'Y', 'Y', 'Y', 'aktif', '14', '31', 'P1', 'lsp', '1', null, '', '08122902645 / 085336214182', '+628122902645', 'Sektor Teknologi industri (Teknik Kendaraan ringan)', 'JAWA TENGAH', null, null, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', null, null, null, null, null, null, null, null);
