INSERT INTO `lsp` VALUES ('lsp461_', 'PERMODALAN NASIONAL MADANI', null, 'Gedung Arthaloka Lt.2 Jl. Jendral Sudirman Kav.2 Jakarta 10220, Indonesia', null, '(021) 2512485 - 86 (Hunting)', '021 - 2512485-86 (Hunting)', '08561366617;081912121224;081219474116', 'modalnasmadani@bnsp.go.id', 'www.lsppnm.com', 'BNSP-LSP-461-ID', '2016-05-18', null, 'Y', null, 'Otoritas Jasa Keuangan', 'PT. PERMODALAN NASIONAL MADANI (Persero)', 'KEP.0538/BNSP/V/2016', null, '2016-05-18', null, 'Faisal Umar/Staf IT LSPPNM/08561366617', null, '0', '0', '1470884166Final-Rev1.png', '2019-05-18', '<p style=\"text-align: justify;\">Organisasi LSP PNM terdiri Dewan \r\nPengarah dan Pelaksana. Unsur Dewan Pengarah terdiri atas ketua dan \r\nanggota yang berasal dari lingkungan PNM (Persero), sedangkan Pelaksana \r\nterdiri atas Ketua LSP PNM, Manajer bidang Administrasi, Sertifikasi dan\r\n Manajemen Mutu.</p>\r\n<p style=\"text-align: justify;\">Dewan Pengarah mempunyai tanggung jawab \r\natas keberlangsungan LSP PNM dengan menetapkan Visi, Misi, dan Tujuan \r\nLSP PNM, program kerja, anggaran belanja, mengangkat dan memberhentikan \r\npengurus LSP PNM, komunikasi dengan stakeholder dan mobilisasi sumber \r\ndaya.</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<h2 style=\"text-align: center;\">&nbsp;<span style=\"text-decoration: underline;\"><strong>STRUKTUR ORGANISASI LSP PNM</strong></span></h2>\r\n<p style=\"text-align: center;\">&nbsp;<img src=\"http://localhost/lsppnm/images/Struktur-Organisasi-LSPPNM.png\" alt=\"\" width=\"700\"></p>\r\n<p style=\"text-align: justify;\">Pelaksana LSP PNM memiliki fungsi \r\n&nbsp;sebagi pelaksana kebijakan yang telah ditetapkan oleh Dewan Pengarah, \r\ndengan tugas-tugas sebagai berikut:</p>\r\n<ul style=\"text-align: justify;\">\r\n<li>Melaksanakan program kerja LSP PNM.</li>\r\n<li>Melakukan monitoring dan evaluasi.</li>\r\n<li>Menyiapkan rencana program dan anggaran.</li>\r\n<li>Memberikan laporan dan bertanggungjawab kepada Pengarah.</li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Bidang Sertifikasi mempunyai tugas:</p>\r\n<ul style=\"text-align: justify;\">\r\n<li>Memfasilitasi penyusunan skema sertifikasi,</li>\r\n<li>Menyiapkan perangkat asesmen dan materi uji,</li>\r\n<li>Melaksanakan kegiatan sertifikasi, termasuk pemeliharaan kompetensi dan sertifikasi ulang,</li>\r\n<li>Menetapkan persyaratan Tempat Uji Kompetesi (TUK),</li>\r\n<li>Melaksanakan verifikasi dan menetapkan TUK,</li>\r\n<li>Melakukan rekrutmen asesor kompetensi serta pemeliharaan kompetensinya.</li>\r\n</ul>\r\n<p>Bidang Manajemen Mutu mempunyai tugas:</p>\r\n<ul style=\"text-align: justify;\">\r\n<li>Mengembangkan menerapkan sistem manajemen mutu LSP PNM sesuai Pedoman BNSP 201.</li>\r\n<li>Memelihara berlangsungnya sistem manajemen agar tetap sesuai dengan standar dan pedoman yang diacu.</li>\r\n<li>Melakukan audit internal dan kaji ulang manajemen LSP PNM.</li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Bagian Administrasi mempunyai tugas:</p>\r\n<ul style=\"text-align: justify;\">\r\n<li>Memfasilitasi unsur-unsur LSP guna terselenggaranya program sertifikasi profesi.</li>\r\n<li>Melaksanakan tugas-tugas ketatausahaan organisasi LSP.</li>\r\n<li>Memelihara informasi sertifikasi kompetensi.</li>\r\n<li>Mempersiapkan laporan kegiatan LSP.</li></ul>', '', 'Y', 'Y', 'Y', 'Y', 'Y', 'Y', '', '12', '17', 'P2', 'lsp', '1', null, '1470884106g_PNM.png', '08561366617', '', 'DKI Jakarta', '021 - 2512485-86 (Hunting)', null, null, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', null, null, null, null, null, null, null, null);
