INSERT INTO `lsp` VALUES ('lsp475_', 'SMK SEPULUH NOPEMBER SIDOARJO', null, 'Jl. Siwalanpanji, Buduran Sidoarjo', null, '(031) 8050111', '(031) 8050111', 'lsp.smksepuluhnopember@gmail.com', 'smk10nopsidoarjo@bnsp.go.id', 'www.smksepuluhnopembersda.com', 'BNSP-LSP-475-ID', '0000-00-00', null, 'Y', null, '', '', 'KEP.0545/BNSP/V/2016', null, '2016-05-19', null, 'Handry Syahriu (083830776740)', null, '0', '0', '14696081020_nevember_sidoarjo.jpg', '2019-05-19', '<br>', '<div class=\"MsoNormal\" style=\"line-height: 150%; margin-left: -14.2pt; mso-pagination: none; text-align: justify; text-autospace: none; text-indent: 50.2pt;\">\r\n<span lang=\"EN-US\">SMK SEPULUH NOPEMBER SIDOARJO </span>adalah<span lang=\"EN-US\"> Sekolah Menengah Kejuruan</span><span lang=\"EN-US\"> </span><span lang=\"EN-US\">swasta </span>bidang keahlian kesehatan yang <span lang=\"EN-US\">pertama kali berdiri di </span>K<span lang=\"EN-US\">abupaten Sidoarjo</span> dan d<span lang=\"EN-US\">idirikan pada tanggal 21 Juni 2010 berdasarkan nomor akte yayasan </span>pendidikan â€œ<span lang=\"EN-US\">PURNAMA</span>â€No:<span lang=\"EN-US\"> 09 tanggal</span><span lang=\"EN-US\"> </span><span lang=\"EN-US\">19 September\r\n2006. </span>SMK Sepuluh Nopember Sidoarjo\r\nini terletak pada lokasi yang strategis, berada pada area pendidikan di\r\nKabupaten Sidoarjo yaitu <span lang=\"EN-US\">di Jalan Siwalanpanji Desa\r\nSiwalanpanji Kecamatan Buduran Kabupaten Sidoarjo Provinsi Jawa Timur Kode Pos\r\n61252 No. Telp.(031) 8</span>050111<span lang=\"EN-US\">.</span> Berdasarkan<span lang=\"EN-US\"> Surat Ijin Penyelenggaraan dari Dinas Pendidikan dan Kebudayaan </span>P<span lang=\"EN-US\">ropinsi Jawa Timur\r\ntanggal 21 Juni 2010 nomor : 421.2/1820/404.3.1/2010 lembaga pendidikan ini\r\nmembuka empat kompetensi keahlian, yaitu kompetensi keahlian Keperawatan,\r\nAnalis Kesehatan, Farmasi, dan Farmasi Industri.</span><span style=\"letter-spacing: .35pt; mso-ansi-language: IN;\"></span></div>\r\n<div class=\"MsoNormal\" style=\"line-height: 150%; margin-left: -14.2pt; mso-pagination: none; text-align: justify; text-autospace: none; text-indent: 50.2pt;\">\r\n<span style=\"letter-spacing: .35pt; mso-ansi-language: IN;\">LSP-P1 SMK SEPULUH NOPEMBER\r\nSIDOARJO d</span><span style=\"letter-spacing: .35pt;\" lang=\"EN-US\">irintis oleh </span><span style=\"letter-spacing: .35pt; mso-ansi-language: IN;\">para pemangku kepentingan\r\nyang p</span><span style=\"letter-spacing: .35pt;\" lang=\"EN-US\">endiri</span><span style=\"letter-spacing: .35pt; mso-ansi-language: IN;\">annya</span><span style=\"letter-spacing: .35pt;\" lang=\"EN-US\"> dipersiapkan oleh Panitia Kerja </span><span style=\"letter-spacing: .45pt;\" lang=\"EN-US\">dalam rangka untuk ikut berperan serta\r\ndalam melaksanakan </span><span style=\"letter-spacing: .55pt;\" lang=\"EN-US\">sertifikasi\r\nkompetensi kerja profesi tenaga kerja di Indonesia </span><span style=\"letter-spacing: .2pt;\" lang=\"EN-US\">sesuai dengan tujuan, sasaran, visi dan misi\r\npeningkatan kualitas </span><span style=\"letter-spacing: .1pt;\" lang=\"EN-US\">kompetensi\r\ndan profesionalisme di dalam negeri dalam arti yang sebenamya.</span><span style=\"letter-spacing: .1pt; mso-ansi-language: IN;\"> LSP SMK SEPULUH NOPEMBER\r\nSIDOARJO didirikan berdasarkan pada Surat Keputusan Dewan Pengarah LSP SMK\r\nSEPULUH NOPEMBER SIDOARJO Nomor : 1/LSP10.11/II/2016 tanggal 27 Februari 2016.</span></div>\r\n<div class=\"MsoNormal\" style=\"line-height: 150%; margin-left: -14.2pt; mso-pagination: none; text-align: justify; text-autospace: none; text-indent: 50.2pt;\">\r\n<span style=\"letter-spacing: .2pt;\" lang=\"EN-US\">Beranjak dari pasar kerja dalam negeri\r\ndan pelanggannya yang membutuhkan </span><span style=\"letter-spacing: .25pt;\" lang=\"EN-US\">peningkatan kualitas profesi bidang </span><span style=\"letter-spacing: .6pt; mso-ansi-language: IN;\">kesehatan</span><span style=\"letter-spacing: .25pt;\"> </span><span lang=\"EN-US\">yang kompeten menjadi faktor penting atas keberhasilan LSP-P1 SMK </span>SEPULUH NOPEMBER SIDOARJO<span style=\"letter-spacing: .35pt;\"> </span><span style=\"letter-spacing: .1pt;\" lang=\"EN-US\">dalam\r\nmendukung program pemerintah, yakni antara lain :</span></div>\r\n<div class=\"MsoNormal\" style=\"line-height: 150%; margin-left: 0cm; mso-list: l1 level1 lfo1; mso-pagination: none; text-align: justify; text-autospace: none; text-indent: -14.4pt;\">\r\n<span style=\"font-size: 10.0pt; letter-spacing: .35pt; line-height: 150%;\" lang=\"EN-US\">a.<span style=\"font-size: 7pt; font-stretch: normal; line-height: normal;\">Â Â Â Â  </span></span><span style=\"letter-spacing: .2pt;\" lang=\"EN-US\">LSP-P1 SMK </span>SEPULUH NOPEMBER SIDOARJO<span style=\"letter-spacing: .35pt;\"> </span><span style=\"letter-spacing: .2pt;\" lang=\"EN-US\">yang\r\ndibentuk dan didirikan merupakan perpanjangan tangan dari </span><span style=\"letter-spacing: .4pt;\" lang=\"EN-US\">BNSP yang bertanggung jawab melaksanakan\r\nsertifikasi kompetensi kerja </span><span style=\"letter-spacing: .2pt;\" lang=\"EN-US\">profesi Bidang</span><span style=\"letter-spacing: .6pt; mso-ansi-language: IN;\"> Kesehatan</span></div>\r\n<div class=\"MsoNormal\" style=\"line-height: 150%; margin-left: 0cm; mso-list: l1 level1 lfo1; mso-pagination: none; text-align: justify; text-autospace: none; text-indent: -14.4pt;\">\r\n<span style=\"font-size: 10.0pt; letter-spacing: .35pt; line-height: 150%;\" lang=\"EN-US\">b.<span style=\"font-size: 7pt; font-stretch: normal; line-height: normal;\">Â Â Â Â  </span></span><span style=\"letter-spacing: .2pt;\" lang=\"EN-US\">Bahwa untuk itu, LSP-P1 SMK </span>SEPULUH NOPEMBER SIDOARJO<span style=\"letter-spacing: .35pt;\"> </span><span style=\"letter-spacing: .2pt;\" lang=\"EN-US\">tidak hanya\r\nbergerak dibidang sektor </span><span style=\"letter-spacing: .6pt; mso-ansi-language: IN;\">Kesehatan</span><span style=\"letter-spacing: .2pt;\" lang=\"EN-US\"> tetapi dapat\r\npula kedepannya dikembangkan ke arah sub-sub bidang pekerjaan lain </span><span style=\"letter-spacing: -.1pt;\" lang=\"EN-US\">sesuai kebutuhan sertifikasi </span><span style=\"letter-spacing: .65pt;\" lang=\"EN-US\">kompetensi tenaga kerja yang akan\r\nbekerja mandiri untuk daerah dan </span><span lang=\"EN-US\">budayanya.</span></div>\r\n<div class=\"MsoNormal\" style=\"line-height: 150%; margin-left: 0cm; mso-list: l1 level1 lfo2; mso-pagination: none; text-align: justify; text-autospace: none; text-indent: -13.5pt;\">\r\n<span style=\"font-size: 10.0pt; letter-spacing: .1pt; line-height: 150%;\" lang=\"EN-US\">c.<span style=\"font-size: 7pt; font-stretch: normal; line-height: normal;\">Â Â Â Â  </span></span><span style=\"letter-spacing: .1pt;\" lang=\"EN-US\">Didorong oleh keinginan untuk memberikan\r\njaminan kualitas <i>(quality insurance) </i></span><span style=\"letter-spacing: .2pt;\" lang=\"EN-US\">dan jaminan keselamatan <i>(safety insurance) </i>pemilik\r\nsertifikat kompetensi kerja </span><span lang=\"EN-US\">dari LSP-P1 SMK </span>SEPULUH NOPEMBER SIDOARJO<span style=\"letter-spacing: .35pt;\"> </span><span lang=\"EN-US\">yang independen sesuai dengan pedoman\r\nBNSP.</span></div>\r\n<div class=\"MsoNormal\" style=\"line-height: 150%; margin-bottom: .0001pt; margin-bottom: 0cm; margin-left: -14.2pt; margin-right: 0cm; margin-top: 12.6pt;\">\r\n<b><span lang=\"EN-US\">VISI </span></b><b><span style=\"color: #02010a; mso-ansi-language: IN;\"></span></b></div>\r\n<div class=\"MsoNormal\" style=\"line-height: 150%; margin-bottom: .0001pt; margin-bottom: 0cm; margin-left: -14.2pt; margin-right: 3.6pt; margin-top: 1.8pt; text-align: justify;\">\r\n<span style=\"letter-spacing: -.2pt;\" lang=\"EN-US\">Menjadi lembaga sertifikasi\r\nprofesi independen yang profesional, akuntabel dan </span>terpercaya dalam melaksanakan proses sertifikasi\r\nkompetensi dalam bidang asisten tenaga kesehatan<span lang=\"EN-US\">.</span></div>\r\n<div class=\"MsoNormal\" style=\"line-height: 150%; margin-bottom: .0001pt; margin-bottom: 0cm; margin-left: -14.2pt; margin-right: 3.6pt; margin-top: 1.8pt; text-align: justify;\">\r\n<br></div>\r\n<div class=\"MsoNormal\" style=\"line-height: 150%; margin-bottom: .0001pt; margin-bottom: 0cm; margin-left: -14.2pt; margin-right: 3.6pt; margin-top: 0cm; mso-pagination: none; text-align: justify; text-autospace: none;\">\r\n<b><span lang=\"EN-US\">M I S I </span></b></div>\r\n<div class=\"MsoNormal\" style=\"line-height: 150%; margin-bottom: .0001pt; margin-bottom: 0cm; margin-left: 0cm; margin-right: 3.6pt; margin-top: 0cm; mso-list: l0 level1 lfo3; mso-pagination: none; text-align: justify; text-autospace: none; text-indent: -10.9pt;\">\r\n<span style=\"font-family: \"Calibri\",\"sans-serif\"; font-size: 11.0pt; letter-spacing: .2pt; line-height: 150%; mso-bidi-font-family: Calibri; mso-fareast-font-family: Calibri;\" lang=\"EN-US\">a.<span style=\"font-family: \'Times New Roman\'; font-size: 7pt; font-stretch: normal; line-height: normal;\">Â  </span></span><span lang=\"EN-US\">Me</span>nyelenggarakan<span lang=\"EN-US\"> program sertifikasi kompetensi kerja bidang </span><span style=\"letter-spacing: .6pt; mso-ansi-language: IN;\">kesehatan</span><span style=\"letter-spacing: .2pt;\"> </span><span style=\"letter-spacing: .2pt; mso-ansi-language: IN;\">yang independen dan profesional </span><span lang=\"EN-US\">sesuai\r\nruang lingkup lisens</span>i <span lang=\"EN-US\">LSP-P1 SMK </span>SEPULUH NOPEMBER\r\nSIDOARJO<span lang=\"EN-US\">.</span></div>\r\n<div class=\"MsoNormal\" style=\"line-height: 150%; margin-bottom: .0001pt; margin-bottom: 0cm; margin-left: 0cm; margin-right: 3.6pt; margin-top: 0cm; mso-list: l0 level1 lfo3; mso-pagination: none; text-align: justify; text-autospace: none; text-indent: -10.9pt;\">\r\n<span style=\"font-family: \"Calibri\",\"sans-serif\"; font-size: 11.0pt; letter-spacing: .2pt; line-height: 150%; mso-bidi-font-family: Calibri; mso-fareast-font-family: Calibri;\" lang=\"EN-US\">b.<span style=\"font-family: \'Times New Roman\'; font-size: 7pt; font-stretch: normal; line-height: normal;\">Â  </span></span>Menjamin mutu dengan menjaga proses sertifikasi\r\nsesuai dengan standar kompetensi kerja nasional yang berlaku.</div>\r\n<div class=\"MsoNormal\" style=\"line-height: 150%; margin-bottom: .0001pt; margin-bottom: 0cm; margin-left: 0cm; margin-right: 3.6pt; margin-top: 0cm; mso-list: l0 level1 lfo3; mso-pagination: none; text-align: justify; text-autospace: none; text-indent: -10.9pt;\">\r\n<span style=\"font-family: \"Calibri\",\"sans-serif\"; font-size: 11.0pt; letter-spacing: .2pt; line-height: 150%; mso-bidi-font-family: Calibri; mso-fareast-font-family: Calibri;\" lang=\"EN-US\">c.<span style=\"font-family: \'Times New Roman\'; font-size: 7pt; font-stretch: normal; line-height: normal;\">Â Â  </span></span>Mendorong tersedianya tenaga kerja yang kompeten,\r\nprofesional dan kompetitif sesuai dengan bidangnya.</div>\r\n<span style=\"font-family: \"Times New Roman\",\"serif\"; font-size: 12.0pt; mso-ansi-language: IN; mso-bidi-language: AR-SA; mso-fareast-font-family: \"Times New Roman\"; mso-fareast-language: EN-US;\">Mengembangkan dan memelihara skema sertifikasi di bidang kesehatan.</span>', 'Y', 'Y', 'Y', 'Y', 'Y', 'Y', 'aktif', '16', '31', 'P1', 'lsp', '1', null, '', '85731501062', '', 'Kesehatan', 'Jawa Timur', null, null, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', null, null, null, null, null, null, null, null);
