</td><td width=\"19\" style=\"box-sizing: border-box; padding: 8px 10px 8px 0px; border-top: 1px solid rgb(241, 241, 241);\">:</td><td width=\"163\" style=\"box-sizing: border-box; padding: 8px 10px 8px 0px; border-top: 1px solid rgb(241, 241, 241);\">Yuslam Fauzi</td><td width=\"164\" style=\"box-sizing: border-box; padding: 8px 10px 8px 0px; border-top: 1px solid rgb(241, 241, 241); margin-bottom: 0px;\">MES</td></tr><tr style=\"box-sizing: border-box;\"><td width=\"119\" style=\"box-sizing: border-box; padding: 8px 10px 8px 0px; border-top: 1px solid rgb(241, 241, 241);\">Wakil Ketua I</td><td width=\"19\" style=\"box-sizing: border-box; padding: 8px 10px 8px 0px; border-top: 1px solid rgb(241, 241, 241);\">:</td><td width=\"163\" style=\"box-sizing: border-box; padding: 8px 10px 8px 0px; border-top: 1px solid rgb(241, 241, 241);\">Dr. Aviliani</td><td width=\"164\" style=\"box-sizing: border-box; padding: 8px 10px 8px 0px; border-top: 1px solid rgb(241, 241, 241); margin-bottom: 0px;\">MES</td></tr><tr style=\"box-sizing: border-box;\"><td width=\"119\" style=\"box-sizing: border-box; padding: 8px 10px 8px 0px; border-top: 1px solid rgb(241, 241, 241);\">Wakil Ketua II</td><td width=\"19\" style=\"box-sizing: border-box; padding: 8px 10px 8px 0px; border-top: 1px solid rgb(241, 241, 241);\">:</td><td width=\"163\" style=\"box-sizing: border-box; padding: 8px 10px 8px 0px; border-top: 1px solid rgb(241, 241, 241);\">Achmad K. Permana</td><td width=\"164\" style=\"box-sizing: border-box; padding: 8px 10px 8px 0px; border-top: 1px solid rgb(241, 241, 241); margin-bottom: 0px;\">ASBISINDO</td></tr><tr style=\"box-sizing: border-box;\"><td width=\"119\" style=\"box-sizing: border-box; padding: 8px 10px 8px 0px; border-top: 1px solid rgb(241, 241, 241);\">Anggota</td><td width=\"19\" style=\"box-sizing: border-box; padding: 8px 10px 8px 0px; border-top: 1px solid rgb(241, 241, 241);\">:</td><td width=\"163\" style=\"box-sizing: border-box; padding: 8px 10px 8px 0px; border-top: 1px solid rgb(241, 241, 241);\">Tati Febriyanti</td><td width=\"164\" style=\"box-sizing: border-box; padding: 8px 10px 8px 0px; border-top: 1px solid rgb(241, 241, 241); margin-bottom: 0px;\">AASI</td></tr><tr style=\"box-sizing: border-box;\"><td width=\"119\" style=\"box-sizing: border-box; padding: 8px 10px 8px 0px; border-top: 1px solid rgb(241, 241, 241);\">Â </td><td width=\"19\" style=\"box-sizing: border-box; padding: 8px 10px 8px 0px; border-top: 1px solid rgb(241, 241, 241);\">:</td><td width=\"163\" style=\"box-sizing: border-box; padding: 8px 10px 8px 0px; border-top: 1px solid rgb(241, 241, 241);\">KH. Abdullah Yazid</td><td width=\"164\" style=\"box-sizing: border-box; padding: 8px 10px 8px 0px; border-top: 1px solid rgb(241, 241, 241); margin-bottom: 0px;\">ABSINDO</td></tr><tr style=\"box-sizing: border-box;\"><td width=\"119\" style=\"box-sizing: border-box; padding: 8px 10px 8px 0px; border-top: 1px solid rgb(241, 241, 241);\">Â </td><td width=\"19\" style=\"box-sizing: border-box; padding: 8px 10px 8px 0px; border-top: 1px solid rgb(241, 241, 241);\">:</td><td width=\"163\" style=\"box-sizing: border-box; padding: 8px 10px 8px 0px; border-top: 1px solid rgb(241, 241, 241);\">Nanang Waskito</td><td width=\"164\" style=\"box-sizing: border-box; padding: 8px 10px 8px 0px; border-top: 1px solid rgb(241, 241, 241); margin-bottom: 0px;\">ASIPPINDO</td></tr><tr style=\"box-sizing: border-box; margin-bottom: 0px;\"><td width=\"119\" style=\"box-sizing: border-box; padding: 8px 10px 8px 0px; border-top: 1px solid rgb(241, 241, 241);\">Â </td><td width=\"19\" style=\"box-sizing: border-box; padding: 8px 10px 8px 0px; border-top: 1px solid rgb(241, 241, 241);\">:</td><td width=\"163\" style=\"box-sizing: border-box; padding: 8px 10px 8px 0px; border-top: 1px solid rgb(241, 241, 241);\">Dody Muhadi</td><td width=\"164\" style=\"box-sizing: border-box; padding: 8px 10px 8px 0px; border-top: 1px solid rgb(241, 241, 241); margin-bottom: 0px;\">FoZ</td></tr></tbody></table></div>', '<p style=\"box-sizing: border-box; margin: 0px 0px 10px; transition: all 0.5s; color: rgb(118, 118, 118); font-family: \"PT Sans\"; font-size: 14px; line-height: 22px; background-color: rgb(255, 255, 255);\">Peningkatan kualitas dan kuantitas sumber daya insani menjadi perhatian bersamaÂ <em style=\"box-sizing: border-box; margin-bottom: 0px;\">stakeholder ekonomi syariah</em>Â karena merupakan salah faktor utama pengembangan dan pertumbuhan peran serta ekonomi syariah dalam ekonomi nasional. Sehubungan hal tersebut, atas undangan Masyarakat Ekonomi Syariah, dilaksanakan pertemuan Silaturahim Pimpinan Asosiasi/Organisasi Ekonomi Syariah pada Rabu, 16 Oktober 2015 yang bertepatan 3 Muharram 1437 H di Jakarta yang dihadiri oleh 7 asosiasi ekonomi syariah, yaitu Masyarakat Ekonomi Syariah (MES), Asosiasi Bank Syariah Indonesia (ASBISINDO), Asosiasi Asuransi Syariah Indonesia (AASI), Asosiasi BMT Seluruh Indonesia (ABSINDO), Asosiasi Perusahaan Penjaminan Indonesia (ASIPPINDO), Asosiasi Hotel & Restoran Syariah Indonesia (AHSIN) dan Asosiasi Organisasi Pengelola Zakat Indonesia (FoZ).</p><p style=\"box-sizing: border-box; margin: 0px 0px 10px; transition: all 0.5s; color: rgb(118, 118, 118); font-family: \"PT Sans\"; font-size: 14px; line-height: 22px; background-color: rgb(255, 255, 255);\">Pertemuan tersebut menyepakati diperlukannya mendirikan Lembaga Sertifikasi Profesi yang mampu menyediakan layanan jasa sertifikasi profesi untuk semua sektor bisnis dan keuangan syariah. Awalnya lembaga ini bernama LSP Bisnis, Jasa Keuangan dan Perbankan Syariah, namun hal ini tidak dapat memenuhi ketentuan yang berlaku di BNSP. Oleh karena itu disepakati untuk mendirikan 2 LSP, yaitu LSP Keuangan Syariah dan LSP Pariwisata Syariah. LSP Keuangan Syariah didirikan oleh MES, ASBISINDO, AASI, ABSINDO, ASIPPINDO, dan FoZ. Sedangkan LSP Pariwisata Syariah akan didirikan oleh MES dan AHSIN beserta stakeholder pariwisata syariah lainnya.</p><p style=\"box-sizing: border-box; margin: 0px 0px 10px; transition: all 0.5s; color: rgb(118, 118, 118); font-family: \"PT Sans\"; font-size: 14px; line-height: 22px; background-color: rgb(255, 255, 255);\">Badan hukum LSP Keuangan Syariah berupa Yayasan sebagaimana termuat dalam akta pendirian Nomer akta 01 tanggal 09 Mei 2016 yang dibuat dihadapan Rini Martini Dahliani, SH, Notaris di Jakarta.</p><p style=\"box-sizing: border-box; margin: 0px; transition: all 0.5s; color: rgb(118, 118, 118); font-family: \"PT Sans\"; font-size: 14px; line-height: 22px; background-color: rgb(255, 255, 255);\">Dengan dilandasi semangat bekerja sama, LSP Keuangan Syariah diharapkan menjadi lembaga yang mampu mensinergikan sumber daya yang ada agar semua praktisi keuangan dan perbankan syariah dapat disertifikasi sebelum pemberlakuan MEA sektor keuangan. LSP Keuangan Syariah juga diharapkan menjadi jembatan dunia pendidikan, dunia industri, dan regulator.</p><p style=\"box-sizing: border-box; margin: 0px; transition: all 0.5s; color: rgb(118, 118, 118); font-family: \"PT Sans\"; font-size: 14px; line-height: 22px; background-color: rgb(255, 255, 255);\"><br></p><h3 style=\"box-sizing: border-box; font-family: \"PT Sans\"; line-height: 1.1; color: rgb(118, 118, 118); margin-top: 0px; margin-bottom: 10px; font-size: 24px; background-color: rgb(255, 255, 255);\">VISI</h3><p style=\"box-sizing: border-box; margin: 0px; transition: all 0.5s; color: rgb(118, 118, 118); font-family: \"PT Sans\"; font-size: 14px; line-height: 22px; background-color: rgb(255, 255, 255);\">Mewujudkan Lembaga Sertifikasi Profesi yang handal dan terpercaya dalam menyelenggarakan sertifikasi tenaga kerjaÂ  untuk mendukung pertumbuhan berkelanjutan industri keuangan syariah.</p><p style=\"box-sizing: border-box; margin: 0px; transition: all 0.5s; color: rgb(118, 118, 118); font-family: \"PT Sans\"; font-size: 14px; line-height: 22px; background-color: rgb(255, 255, 255);\"><br></p><h3 style=\"box-sizing: border-box; font-family: \"PT Sans\"; line-height: 1.1; color: rgb(118, 118, 118); margin-top: 0px; margin-bottom: 10px; font-size: 24px; background-color: rgb(255, 255, 255);\">Misi</h3><ol style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; color: rgb(118, 118, 118); font-family: \"PT Sans\"; font-size: 14px; line-height: 22px; background-color: rgb(255, 255, 255);\"><li style=\"box-sizing: border-box;\">Menjadi Lembaga Sertifikasi Profesi dengan integritas tinggi dan diakui di dalam negeri dan di luar negeri</li><li style=\"box-sizing: border-box;\">Mendukung pengembangan ekonomi syariah melalui ketersediaan SDM dengan kompetensi yang berstandar.</li><li style=\"box-sizing: border-box;\">Mendukung lembaga pendidikan ekonomi Syariah khususnya pendidikan vokasional mengembangkan pendidikan yang sesuai dengan kebutuhan industri</li><li style=\"box-sizing: border-box;\">Membangun sinergi antar stakeholder ekonomi syariah (Â <em style=\"box-sizing: border-box; margin-bottom: 0px;\">amal jamaâ€™i</em>Â ) mengembangkan industri Keuangan Syariah</li><li style=\"box-sizing: border-box; margin-bottom: 0px;\">Mengembangkan layanan berbasis IT sehingga lebih akuntabel, cepat dan terjangkau.</li></ol>', 'Y', 'Y', 'Y', 'Y', 'Y', 'Y', 'aktif', '12', '17', 'P3', 'lsp', '1', null, '', '0817820228', '0817820228', 'Keuangan Syariah', 'DKI Jakarta', null, null, '0', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', null, null, null, null, null, null, null, null);
